var $bm_rt;
var timeStart, duration, pingPong, quant, quant, t, t, t;
try {
    timeStart = thisProperty.key(1).time;
    duration = $bm_sub(thisProperty.key(thisProperty.numKeys).time, timeStart);
    pingPong = false;
    quant = Math.floor($bm_div($bm_sub(time, timeStart), duration));
    if (quant < 0)
        quant = 0;
    if (quant % 2 == 1 && pingPong == true) {
        t = $bm_sub($bm_sum($bm_mul(2, timeStart), $bm_mul($bm_sum(quant, 1), duration)), time);
    } else {
        t = $bm_sub(time, $bm_mul(quant, duration));
    }
} catch (err) {
    t = time;
}
$bm_rt = thisProperty.valueAtTime(t);

